import { Height } from '@mui/icons-material';
import KALMA from './images/KALMALogo.png';

const Project = () => {
  return (
    <section class="project">
      <div class="title">
        <h1>Portfolio</h1>
        <h3>Collaborated Project</h3>
      </div>
      <div class="box">
        <img src={KALMA} alt="KALMA"/>
        <h1>KALMA - Kalinga at Agarang Lunas Mobile Application</h1>
        <p>This mobile application was created as a final project in our subject CAPSTONE 401.</p>
        <form href="https://play.google.com/store/apps/details?id=com.kalma.capstonev12">
          <input class="btn btn-s" type="submit" value="Submit" target="_blank" />
        </form>
        </div>  
    </section>
  )
}

let sections = document.querySelectorAll('section');
window.onscroll = () => {
  sections.forEach(sec =>{
    let top = window.scrollY;
    let offset = sec.offsetTop;
    let hieght = sec.offsetHeight;

    if (top >= offset && top < offset + hieght){
      sec.classList.add('showAnimate');
    }
    else{
      sec.classList.remove('showAnimate');
    }

  })

}

export default Project
